		description: "The Samsung Galaxy S20 FE, or Fan Edition, promises the most popular features of the flagship Galaxy S20 family at a much lower price. You get the same Exynos 990 processor, plus a 6.5-inch full-HD+ 120Hz Super AMOLED screen and a 4500mAh battery. The body is polycarbonate but this phone still feels premium, and is IP68 rated for water and dust resistance. You get plenty of high-end features including stereo speakers and wireless charging. The three rear cameras are all practical and deliver great results in the daytime, though the ultra-wide one does suffer a bit at night. Video and stills both came out looking good, and the camera app offers plenty of modes and settings to experiment with. Battery life is somewhat disappointing but Samsung's One UI software is quite good and the display is great for videos and games. The phone does get a bit warm in use but is otherwise a satisfactory premium option.",
